import io from "socket.io-client";
import React from "react";
import ReactDOM from "react-dom";
import { useEffect, useState, useRef } from "react";
import {
  Line,
  LineChart,
  XAxis,
  YAxis,
  Tooltip,
  Label,
  AreaChart,
  linearGradient,
  Area,
  CartesianGrid,
} from "recharts";
import axios from "axios";

const Home = ({}) => {
  const [data, setData] = useState([]);

  const [timer, setTimer] = useState(3595);
  const increment = useRef(null);
  const increment2 = useRef(null);

  /* função ao montar */

  const iniGrafico = () => {
    try {
      increment2.current = setInterval(() => {
        const chegada = axios.get("http://127.0.0.1:5000/").then((response) => {
          setData((cpuPorcentagem) => [...cpuPorcentagem, response.data[0]]);
        });
      }, 2000);
    } catch (error) {
      console.log("erro na coneção");
    }
  };

  const useMountEffect = (fun) => useEffect(fun, []);
  useMountEffect(iniGrafico);
  return (
    <div>
      <h1>Monitor de recursos</h1>
      <LineChart width={500} height={300} data={data}>
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Label />
        <Line dataKey="value" stroke="#8884d8" activeDot={{ r: 8 }} />
      </LineChart>
      <AreaChart
        width={500}
        height={300}
        data={data}
        margin={{ top: 10, right: 30, left: 0, bottom: 0 }}
      >
        <defs>
          <linearGradient id="colorPv" x1="0" y1="0" x2="0" y2="1">
            <stop offset="5%" stopColor="#82ca9d" stopOpacity={0.8} />
            <stop offset="95%" stopColor="#82ca9d" stopOpacity={0} />
          </linearGradient>
        </defs>
        <XAxis dataKey="name" />
        <YAxis />
        <CartesianGrid strokeDasharray="3 3" />
        <Tooltip />
        <Area
          type="monotone"
          dataKey="value"
          stroke="#82ca9d"
          fillOpacity={1}
          fill="url(#colorPv)"
        />
      </AreaChart>
    </div>
  );
};

export default Home;
